import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import ChatRoom from "../pages/ChatRoom";
export default function () {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="chatroom" element={<ChatRoom />} />
        </Routes>
      </BrowserRouter>
    </>
  );
}
